import React, { useState, useEffect } from "react";

export default function SuperUserData() {
  const [loading, setLoading] = useState(true);
  const [data, setData] = useState([]);
  useEffect(() => {

    fetch("http://localhost:5000/getAllData")
      .then((response) => response.json())
      .then((data) => {
        setData(data);
        setLoading(false);
      });
  }, []);

  const handleDelete = (id, userType) => {
    if (userType === "user") {
      // Delete user logic
      // You can send a request to delete the user with the given id
    } else if (userType === "company") {
      // Delete company logic
      // You can send a request to delete the company with the given id
    }
  };

  return (
    <div>
      <h2>All Data for Super User</h2>
      {loading ? (
        <p>Loading...</p>
      ) : (
        <div>
          <h3>Users and Companies:</h3>
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>First Name</th>
                <th>Last Name</th>
                <th>User Type</th>
                <th>Delete</th>
              </tr>
            </thead>
            <tbody>
              {data.users.map((user) => (
                <tr key={user._id}>
                  <td>{user._id}</td>
                  <td>{user.fname}</td>
                  <td>{user.lname}</td>
                  <td>{user.userType}</td>
                  <td>
                    <button onClick={() => handleDelete(user._id, user.userType)}>
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
              {data.companies.map((company) => (
                <tr key={company._id}>
                  <td>{company._id}</td>
                  <td>{company.fname}</td>
                  <td>{company.lname}</td>
                  <td>{company.userType}</td>
                  <td>
                    <button onClick={() => handleDelete(company._id, company.userType)}>
                      Delete
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
